 Informuojame, kad pastato Bajorų kel. 17 požeminė automobilių stovėjimo aikštelė ir kiemo teritorija patenka į suformuotą žemės sklypą. Šio sklypo Savivaldybė nevaldo, todėl neturi teisės atnaujinti ženklinimą Jūsų nurodytoje vietoje. Ženklinimo atnaujinimu turi rūpintis požeminės automobilių stovėjimo aikštelės valdytojai. Vadovaujantis Vilniaus miesto savivaldybės administracijos direktoriaus 2009 m. spalio 15 d. įsakymo Nr. 30-1783 „Dėl techninių eismo reguliavimo priemonių įrengimo ir jų priežiūros Vilniaus mieste tvarkos aprašo tvirtinimo“ 9 punktu Vilniaus miesto savivaldybės administracija nerengia techninių eismo reguliavimo priemonių įrengimo projektų, neįrengia techninių eismo reguliavimo priemonių, užtvarų ir nekontroliuoja jų įrengimo teisėtumo Vilniaus miesto savivaldybės teritorijoje esančiuose suformuotuose žemės sklypuose, kai sklypą ar jo dalį:
- nuosavybės ar kita teise valdo fiziniai ar privatieji juridiniai asmenys;
              - valdo valstybinės žemės patikėjimo teisės subjektai (patikėtiniai), išskyrus Vilniaus miesto savivaldybę.

DESCRIPTION:
Prašome įrengti gatvės apšvietimą neasfaltuotoje Šeduvos g., Šiauliai, atkarpoje nuo 56 iki 65 gatvės numerio, nes:
- Gatvėje gyvena šeimos su mažamečiais vaikais, norime užtikrinti jų saugumą;
- Neapšviesta gatvės dalis tampa padidintos rizikos vieta nusikalstamumui. Mūsų namas jau buvo apvogtas;
- Tamsiu paros metu apylinkėse vaikšto ir/ar vartoja alkoholį asocialūs asmenys, todėl jaučiamės nesaugūs dėl grėsmės būti užpultiems. Apšviestoje gatvėje tokio susidūrimo galima išvengti iš anksto pamačius grėsmę;
- Šeduvos gatvės asfaltuotoje dalyje gatvės apšvietimas įrengtas, taip pat Salduvės gatvėje yra įrengtas apšvietimas;
- Per neasfaltuotos gatvės dalį patenkama į Salduvė gatvės dalį nuo 41 iki 61 numerio;
- Prašomos apšviesti gatvės dalis sudaro 432 metrus;
